import './App.css';
//import Paginas from './components/Paginas';
import data from './db.json'
import {Link , BrowserRouter} from 'react-router-dom'

function App() {
  return (
    <BrowserRouter>
    <div>
      {data.map((empresa)=>{
        return (
          <Link to={empresa.cliente}> </Link>
        )
      })}
      {/* <Paginas /> */}
    </div>
    </BrowserRouter>
  );
}

export default App;
